class Problem {
    // Input is a space-delimited string of numberals from 'zero' to 'nine'.
    // Valid choices are 'zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight' and 'nine'.
    // Return the string with numbers sorted from smallest to largest
    // >>> sortNumbers(("three one five"))
    // ("one three five")
    public static String sortNumbers(String numbers) {
        String[] nums = numbers.split(" ");
        Map<String, Integer> numMap = new HashMap<String, Integer>();
        numMap.put("zero", 0);
        numMap.put("one", 1);
        numMap.put("two", 2);
        numMap.put("three", 3);
        numMap.put("four", 4);
        numMap.put("five", 5);
        numMap.put("six", 6);
        numMap.put("seven", 7);
        numMap.put("eight", 8);
        numMap.put("nine", 9);

        Integer[] numsInt = new Integer[nums.length];
        for (int i = 0; i < nums.length; i++) {
            numsInt[i] = numMap.get(nums[i]);
        }

        Arrays.sort(numsInt);

        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < numsInt.length; i++) {
            for (Map.Entry<String, Integer> entry : numMap.entrySet()) {
                if (entry.getValue().equals(numsInt[i])) {
                    sb.append(entry.getKey());
                    if (i < numsInt.length - 1) {
                        sb.append(" ");
                    }
                }
            }
        }
        return sb.toString();

